import React from "react";
// import App from "./App";

function SignUp(props) {
  const { values, submit, change, disabled, errors } = props;

  const onSubmit = (evt) => {
    evt.preventDefault();
    submit();
  };

  const onChange = (evt) => {
    const { name, value, type, checked } = evt.target;
    const valueToUse = type === "checkbox" ? checked : value;
    change(name, valueToUse);
  };

  return (
    <div className="App">
      <h2>Sleep better. Feel better. Live better. TODAY!</h2>
      <div className="logInForm">
        <h2>Sign Up!</h2>
        <p>Join Sleep Tracker for better sleep.</p>
        <br />

        <input
          className="fName"
          name="fName"
          type="fName"
          value="fName"
          onChange={onChange}
          placeholder="Enter your First Name"
        />
        <br />
        <br />
        <input
          className="lName"
          name="lName"
          type="lName"
          value="lName"
          onChange={onChange}
          placeholder="Enter your Last Name"
        />
        <br />
        <br />
        <input
          className="uName"
          name="uName"
          type="uName"
          value="uName"
          onChange={onChange}
          placeholder="Create your User Name"
        />
        <br />
        <br />
        <input
          className="email"
          name="email"
          type="email"
          value="email"
          onChange={onChange}
          placeholder="Enter your Email"
        />
        <br />
        <br />
        <input
          className="password"
          name="password"
          type="password"
          value="password"
          onChange={onChange}
          placeholder="Create your Password"
        />
        <br />
        <br />
        <button>Create Sleep Profile!</button>
        <br />
        <br />
        <a href="/">
          Already a Member?
          <br />
          Sign-In to get better sleep!
        </a>
      </div>
    </div>
  );
}

export default SignUp;
